          [screen.id]: screen,
        },
      }))
    },
    [store]
  )

  const removeScreen = useCallback(
    ({ screenId }: { screenId: string }) => {
      store.setState((prevState) => ({
        ...prevState,
        screens: {
          ...prevState.screens,
          [screenId]: undefined,
        },
      }))
    },
    [store]
  )

  const addScreenInstanceOption = useCallback(
