        ...prevState,
        screenEdge,
      }))
    },
    [store]
  )

  return useMemo(
    () => ({
      addScreen,
      removeScreen,
      addScreenInstanceOption,
      addScreenInstancePromise,
      mapScreenInstance,
      insertScreenInstance,
      increaseScreenInstancePtr,
      setScreenInstancePtr,
      setScreenEdge,
    }),
    [
      addScreen,
      removeScreen,
      addScreenInstanceOption,
      addScreenInstancePromise,
      mapScreenInstance,
      insertScreenInstance,
      increaseScreenInstancePtr,
      setScreenInstancePtr,
      setScreenEdge,
    ]
  )
}
